async function setup(){const t=document.getElementById("chart").getContext("2d"),a=await getData(),e=await getDifferentData();new Chart(t,{type:"line",data:{labels:a.years,datasets:[{label:"Temps",data:a.temps,fill:!1,borderColor:"rgba(18, 26, 140, 1)",backgroundColor:"rgba(18, 26, 140, 1)",borderWidth:1},{label:"Other Temps",data:e.temps,fill:!1,borderColor:"rgba(245, 27, 27, 1)",backgroundColor:"rgba(245, 27, 27, 1)",borderWidth:1}]}})}async function getData(){const t=await fetch("ZonAnn.Ts+dSST.csv"),a=await t.text(),e=[],s=[];return a.split("\n").slice(1).forEach((t=>{const a=t.split(",");e.push(a[0]),s.push(14+parseFloat(a[1]))})),{years:e,temps:s}}async function getDifferentData(){const t=await fetch("GLB.Ts+dSST.csv"),a=await t.text(),e=[],s=[];return a.split("\n").slice(2).forEach((t=>{const a=t.split(",");e.push(a[0]),s.push(14+parseFloat(a[1]))})),{years:e,temps:s}}window.addEventListener("load",setup);